import React from 'react';

const About = () => {
  return (
    <section id="about" className="about">
      <div className="container">
        <h2>About Me</h2>
        <div className="about-content">
          <div className="about-text">
            <p>I'm a passionate developer with expertise in creating beautiful, functional web applications. I love turning ideas into reality through clean code and thoughtful design.</p>
            <p>With experience in modern web technologies, I focus on building user-friendly interfaces and robust backend systems.</p>
          </div>
          <div className="about-image">
            <div className="image-placeholder">Your Photo</div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
